    background:"#5682a3",
    height:"300px"
};
const GreyFone = {
    background:"#e7ebf0",
    height:"calc(100% - 300px)"
};

export const LoginLayout = props => {
    return <>
        <div style={BlueFone}></div>
            <LoginContainer/>
        <div style={GreyFone}></div>
    </>
};
